import { Provider } from 'react-redux';
import store from './store/Store';

import Game from './components/Game';
import './App.css';
import { useState } from 'react';



function App() {
    const [isLoading, setIsLoading] = useState(true);

    return (
      <Provider store={store}>
        <Game />
      </Provider>
    );
}

export default App;
